    false,nt"url": null,nt"notes": "Wooded Islands and the surrounding waters
    are threatened with oil pollution in the near future. Outer Continental Shelf oil
    and gas exploration has already begun in the northern Gulf, and the Valdez terminal
    of the Trans-Alaska oil pipeline is scheduled to begin operation in the summer of
    1977. Since currents in the Gulf flow in a counterclockwise direction, oil spilled
    near Hinchinbrook Entrance or in the lease area near Kayak Island may be expected
    to reach Wooded Islands.",nt"owner_org": "4d7ad1cd-3641-420b-8116-e4082f49cd44",nt"extras":
